'''汤敏'''是中国内地女歌手、演员，'''AKB48'''的中国官方姐妹团体'''SNH48'''的一期生。 

== 简介 ==
SNH48初期top,后顶替赵嘉敏成为首支单曲《无尽旋转》的C,从而正式成为SNH 双ACE之一。
2013年，在剧场开业前夕，以身体不适为由长期请假，随后启用私博证实已经退出SNH48。{{黑幕|后多次传出回归，本人已于微博澄清。目前是否恢复学业未知，职业疑似淘宝店主}}

